css:
@import 'languages/css';
atom-text-editor {
  background-color: #282828;
  color: #ebdbb2;
}
atom-text-editor .line.cursor-line {
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .invisible {
  color: #ebdbb2;
}
atom-text-editor .cursor {
  border-left: 2px solid #a89984;
}
atom-text-editor .selection .region {
  background-color: #424242;
}
atom-text-editor .bracket-matcher .region {
  border-bottom: 2px solid #a89984;
  box-sizing: border-box;
  background-color: #373737;
}
atom-text-editor .invisible-character {
  color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .indent-guide {
  color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .indent-guide:nth-child(2n) {
  box-shadow: inset 1px 0 rgba(235, 219, 178, 0.25);
}
atom-text-editor .wrap-guide {
  background-color: rgba(235, 219, 178, 0.15);
}
atom-text-editor .gutter .line-number {
  color: #928374;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(251, 73, 52, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line {
  color: #f9f5d7;
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  background-color: rgba(249, 245, 215, 0.04);
}
atom-text-editor .gutter .line-number .icon-right {
  color: #ebdbb2;
}
atom-text-editor .gutter .line-number .icon-right {
  color: #ebdbb2;
}
atom-text-editor .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
atom-text-editor .fold-marker:after {
  color: #f9f5d7;
}
.syntax--comment {
  color: #928374;
  font-style: italic;
  /* Keywords inside comments (e.syntax--g. yard, javadoc, etc) should be more subdued
     than other keywords */
}
.syntax--comment .syntax--keyword,
.syntax--comment .syntax--keyword.syntax--punctuation {
  color: #d5c4a1;
}
.syntax--comment .syntax--punctuation {
  color: #bdae93;
}
.syntax--comment .syntax--string,
.syntax--comment .syntax--type,
.syntax--comment .syntax--parameter {
  color: #bdae93;
}
.syntax--entity.syntax--name.syntax--type {
  color: #fabd2f;
}
.syntax--entity.syntax--other.syntax--inherited-class {
  color: #fabd2f;
}
.syntax--keyword {
  color: #fb4934;
}
.syntax--keyword.syntax--control {
  color: #fb4934;
}
.syntax--keyword.syntax--operator {
  color: #ebdbb2;
}
.syntax--keyword.syntax--other.syntax--special-method {
  color: #fe8019;
}
.syntax--keyword.syntax--other.syntax--unit {
  color: #d3869b;
}
.syntax--storage {
  color: #fb4934;
